import {CloseBtn} from './styled-components'

export default function Card({name, species, gender, image, onClose}) {
   return (
      <div>
         onClose={() => window.alert('Emulamos que se cierra la card')}
         <CloseBtn onClose={() => window.alert('Emulamos que se cierra la card')}>X</CloseBtn>
         <h2>{name}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <img src={image} alt={name} />
      </div>
   );
}
